import React from 'react'
import "./Topbar.css"
import AddIcon from '@mui/icons-material/Add';
import { NavLink } from 'react-router-dom';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
function Topbar() {
    return (
        <div class="navbar">
            <div class="brand">
                <NavLink to="/" ><a className="navbar-brand">UNH Social</a></NavLink>
            </div>
            <div className='right'>
                <NavLink to="/create/post"><AddIcon style={{ color: "#ffffff", fontSize: 30 }} /></NavLink>
                <AccountCircleIcon style={{ fontSize: 40 }} />
            </div>
        </div>
    )
}

export default Topbar
